import React, { useState } from 'react';

const DonorDetails = ({ donorStockList, handleCheckBloodConditions }) => {
  const [selectedDonor, setSelectedDonor] = useState(null);
  const [formValues, setFormValues] = useState({
    generalHealth: 'good',
    disqualifyingMedications: 'no',
    recentTravel: 'no',
    recentTattoos: 'no',
    recentSexualActivity: 'no',
    drugUse: 'no',
    bloodStatus: 'safe',
  });

  const handleCheckBlood = (donorId) => {
    const donor = donorStockList.find((d) => d.donor_id === donorId);
    setSelectedDonor(donor);
  };

  const handleFormSubmit = () => {
    handleCheckBloodConditions(selectedDonor.donor_id, formValues);
    setSelectedDonor(null);
  };

  return (
    <div>
      <h1 className="text-3xl font-bold mb-4">Donor details</h1>
      <table className="w-full border border-collapse">
        <thead>
          <tr className="bg-gray-200">
            <th className="py-2 px-4 border">Donor Name</th>
            <th className="py-2 px-4 border">Blood Group</th>
            <th className="py-2 px-4 border">Unit</th>
            {/* Add more table headers as needed */}
            <th className="py-2 px-4 border">Actions</th>
          </tr>
        </thead>
        <tbody>
          {donorStockList.map((donorStock, index) => (
            <tr key={donorStock.donor_id || index} className="hover:bg-gray-100">
              <td className="py-2 px-4 border">{donorStock.donor_name}</td>
              <td className="py-2 px-4 border">{donorStock.blood_group}</td>
              <td className="py-2 px-4 border">{donorStock.unit}</td>
              {/* Add more table cells as needed */}
              <td className="py-2 px-4 border">
                <button onClick={() => handleCheckBlood(donorStock.donor_id)}>Check Blood</button>
              </td>
            </tr>
          ))}
        </tbody>
      </table>

      {selectedDonor && (
        <div>
          <h2>Check Blood Conditions for {selectedDonor.donor_name}</h2>
          <form>
            {/* Add form fields for each condition */}
            <label>
              General Health:
              <input type="text" value={formValues.generalHealth} onChange={(e) => setFormValues({ ...formValues, generalHealth: e.target.value })} />
            </label>
            {/* Add similar fields for other conditions */}
            <label>
              Disqualifying Medications:
              <input type="text" value={formValues.disqualifyingMedications} onChange={(e) => setFormValues({ ...formValues, disqualifyingMedications: e.target.value })} />
            </label>
            <label>
              Recent Travel:
              <input type="text" value={formValues.recentTravel} onChange={(e) => setFormValues({ ...formValues, recentTravel: e.target.value })} />
            </label>
            <label>
              Recent Tattoos:
              <input type="text" value={formValues.recentTattoos} onChange={(e) => setFormValues({ ...formValues, recentTattoos: e.target.value })} />
            </label>
            <label>
              Recent Sexual Activity:
              <input type="text" value={formValues.recentSexualActivity} onChange={(e) => setFormValues({ ...formValues, recentSexualActivity: e.target.value })} />
            </label>
            <label>
              Drug Use:
              <input type="text" value={formValues.drugUse} onChange={(e) => setFormValues({ ...formValues, drugUse: e.target.value })} />
            </label>
            {/* Blood Status (Assuming it's a dropdown) */}
            <label>
              Blood Status:
              <input type="text" value={formValues.bloodStatus} onChange={(e) => setFormValues({ ...formValues, bloodStatus: e.target.value })} />
            </label>
            <button type="button" onClick={handleFormSubmit}>Submit</button>
          </form>
        </div>
      )}
    </div>
  );
};

export default DonorDetails;
